    while j >= 0:
        if len(vis & li[j]) == 0:
            out.append(j)
            vis = vis | li[j]
            if len(vis) == n:
                break
        j -= 1
    for i in range(len(out)):
        print(out[len(out) - 1 - i], end=' ')
    print()
